from PyQt5.QtCore import QByteArray
from PyQt5.QtGui import QPixmap


def Base642QPixmap(base64):
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64))
    return pixmap


def back_pixmap():
    return Base642QPixmap(b'')


def next_pixmap():
    return Base642QPixmap(b'')


def home_pixmap():
    return Base642QPixmap(b'')